<div class=" highlight hl-ipython3"><pre><span></span><span class="k">def</span> <span class="nf">homogeneity</span><span class="p">(</span><span class="n">network</span><span class="p">,</span> <span class="n">partition</span><span class="p">,</span> <span class="n">col</span><span class="o">=</span><span class="s1">&#39;party&#39;</span><span class="p">):</span>
    <span class="n">enc</span> <span class="o">=</span> <span class="n">LabelEncoder</span><span class="p">()</span>
    <span class="n">partition_sorted</span> <span class="o">=</span> <span class="p">[</span><span class="n">i</span><span class="p">[</span><span class="mi">1</span><span class="p">]</span> <span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">sorted</span><span class="p">(</span><span class="n">partition</span><span class="o">.</span><span class="n">items</span><span class="p">())]</span>
    <span class="n">data_sorted</span> <span class="o">=</span> <span class="p">[</span><span class="n">i</span><span class="p">[</span><span class="mi">1</span><span class="p">][</span><span class="n">col</span><span class="p">]</span> <span class="k">for</span> <span class="n">i</span> <span class="ow">in</span> <span class="nb">sorted</span><span class="p">(</span><span class="n">network</span><span class="o">.</span><span class="n">nodes</span><span class="p">(</span><span class="n">data</span><span class="o">=</span><span class="kc">True</span><span class="p">))]</span>
    <span class="n">data_enc</span> <span class="o">=</span> <span class="n">enc</span><span class="o">.</span><span class="n">fit_transform</span><span class="p">(</span><span class="n">data_sorted</span><span class="p">)</span>
    <span class="n">homog</span> <span class="o">=</span> <span class="n">homogeneity_score</span><span class="p">(</span><span class="n">partition_sorted</span><span class="p">,</span> <span class="n">data_enc</span><span class="p">)</span>
    <span class="k">return</span> <span class="n">homog</span>


<span class="k">def</span> <span class="nf">mean_conductance</span><span class="p">(</span><span class="n">network</span><span class="p">,</span> <span class="n">partition</span><span class="p">):</span>
    <span class="n">conds</span> <span class="o">=</span> <span class="p">[]</span>
    <span class="k">for</span> <span class="n">comm_id</span> <span class="ow">in</span> <span class="nb">set</span><span class="p">(</span><span class="n">partition</span><span class="o">.</span><span class="n">values</span><span class="p">()):</span>
        <span class="n">comm_nodes</span> <span class="o">=</span> <span class="p">[</span><span class="n">node</span> <span class="k">for</span> <span class="n">node</span><span class="p">,</span> <span class="n">comm</span> <span class="ow">in</span> <span class="n">partition</span><span class="o">.</span><span class="n">items</span><span class="p">()</span> <span class="k">if</span> <span class="n">comm</span> <span class="o">==</span> <span class="n">comm_id</span><span class="p">]</span>
        <span class="n">node_n</span> <span class="o">=</span> <span class="nb">len</span><span class="p">(</span><span class="n">comm_nodes</span><span class="p">)</span>
        <span class="n">sg</span> <span class="o">=</span> <span class="n">network</span><span class="o">.</span><span class="n">subgraph</span><span class="p">(</span><span class="n">comm_nodes</span><span class="p">)</span>
        <span class="c1"># Calculating conductance on a single-node community will result in a </span>
        <span class="c1"># zero-division error</span>
        <span class="k">if</span> <span class="n">node_n</span> <span class="o">&lt;</span> <span class="mi">2</span><span class="p">:</span>
            <span class="k">continue</span>
        <span class="k">else</span><span class="p">:</span>
            <span class="n">cond</span> <span class="o">=</span> <span class="n">np</span><span class="o">.</span><span class="n">round</span><span class="p">(</span><span class="n">nx</span><span class="o">.</span><span class="n">conductance</span><span class="p">(</span><span class="n">network</span><span class="p">,</span> <span class="n">sg</span><span class="p">,</span> <span class="n">weight</span><span class="o">=</span><span class="s1">&#39;weight&#39;</span><span class="p">),</span> <span class="mi">3</span><span class="p">)</span>
            <span class="n">conds</span><span class="o">.</span><span class="n">append</span><span class="p">(</span><span class="n">cond</span><span class="p">)</span>
    <span class="n">mean_cond</span> <span class="o">=</span> <span class="n">np</span><span class="o">.</span><span class="n">mean</span><span class="p">(</span><span class="n">conds</span><span class="p">)</span>
    <span class="k">return</span> <span class="n">mean_cond</span> <span class="k">if</span> <span class="ow">not</span> <span class="n">math</span><span class="o">.</span><span class="n">isnan</span><span class="p">(</span><span class="n">mean_cond</span><span class="p">)</span> <span class="k">else</span> <span class="mf">0.</span>
</pre></div>

