<p>Perhaps unsurprisingly, House Speakers feature prominently on this list, including Dennis Hastert, Nancy Pelosi, John Boehner, and Paul Ryan (as do other high-ranking figures such as Steny Hoyer and Kevin McCarthy). Their central roles in the House dictate that they reach out to as many political corners of the House as possible. (Prior to the full politicization of the office, at least: looking at the data above, the Speaker's bridge role starts to wane in the 111th Congress, and by the 113th Paul Ryan is nowhere to be seen in the top five. He claws back to number four in the 114th.)</p>

